INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(7, 'F', 'Agente 007 - Licenza di uccidere', 1962, '\"Tre uomini, presumibilmente ciechi, camminano per Kingston, nella Giamaica britannica. I tre avvicinano John Strangways, un ufficiale della stazione J dell\'MI6, il quale d√† loro del denaro come elemosina: tuttavia questi gli sparano e lo nascondono nel carro funebre di un complice. \r\n\r\nIn seguito, irrompono nello studio della segretaria di Strangways, la uccidono mentre si trova in comunicazione radiofonica con l\'Inghilterra, e trafugano cartelle di documenti contrassegnate \"\"Crab Key\"\" e \"\"Doctor No\"\".\r\n', NULL, 'Terence Young', 'Sean Connery, Ursula Andress, Joseph Wiseman, Jack Lord, Anthony Dawson, Zena Marshall, John Kitzmiller, Eunice Gayson, Bernard Lee', NULL, 'data:image/jpeg;base64,', 1);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(8, 'F', 'Agente 007 - dalla Russia con amore', 1963, 'Uno spietato assassino, Donald \"Red\" Grant, uccide durante un\'esercitazione un uomo mascherato da James Bond. Intanto lo scacchista Tov Kronsteen organizza un piano per la SPECTRE (nella quale √® il Numero Cinque) per rubare all\'Unione Sovietica il Lektor, un apparecchio per decrittare messaggi cifrati e, nel contempo, uccidere Bond per vendicare la morte del dottor Julius No. Ernst Stavro Blofeld, misterioso capo della SPECTRE, affida gli aspetti tecnici alla Numero Tre Rosa Klebb, che recluta Grant come assassino e Tatiana Romanova come inconsapevole pedina.\r\n\r\n', NULL, 'Terence Young', 'Sean Connery', NULL, 'data:image/jpeg;base64,', 0);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(12, 'F', 'Agente 007 - Il domani non muore mai', 1997, '\"MI6 invia James Bond in Afghanistan per neutralizzare una gang di commercianti d\'armi, tra cui il pioniere del tecnoterrorismo Henry Gupta, braccato dall\'FBI. Nonostante M insista nel lasciare che 007 finisca la sua azione, l\'ammiraglio britannico Roebuck ordina alla fregata HMS Chester di sparare un missile al bazar. Bond poi scopre che su un L-39 Albatross sono montati due missili nucleari ed √® costretto a portar via - con non poca difficolt√† - il velivolo alcuni secondi prima che il bazar sia distrutto.\r\n\r\nAllo stesso tempo, Bond risale cos√¨ a Elliot Carver, magnate dei media, interessato a distruggere governi e carriere di vip con i suoi servizi. Questi, inoltre, stimola la reazione dell\'MI6 in quanto ha intenzione di scatenare una guerra tra Cina e Inghilterra. Intercettandone il segnale GPS, Gupta manda la fregata HMS Devonshire fuori rotta nelle acque territoriali cinesi nel Mar Cinese Meridionale; qui la nave viene distrutta attraverso una nave stealth, invisibile ai radar, che abbatte anche un J-7 jet da combattimento cinese. Il tutto avviene con armi rubate da entrambe le parti per far risultare che ci sia stato un attacco incrociato. Il britannico Ministro della Difesa ordina di spostare la flotta per recuperare la fregata e possibilmente rivalersi, lasciando solo 48 ore a M per indagare sul suo affondamento prima di entrare in guerra.', NULL, 'Roger Spottiswoode', 'Pierce Brosnan, Jonathan Pryce, Michelle Yeoh, Teri Hatcher, Joe Don Baker, Judi Dench', NULL, 'data:image/jpeg;base64,', 0);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(13, 'L', 'Casino Royale', 1953, 'Il 15 gennaio del 1952, quando si siede alla scrivania di Goldeneye, la sua villa in Giamaica, Ian Fleming non ha idea di cosa scriver√†. Parte dal nome del suo personaggio, rubato a un allora celebre ornitologo, e dal ricordo di una partita a carte al Casino di Lisbona, nel 1941. Il primo James Bond nasce cos√¨, ed √® un romanzo molto diverso da come forse lo stesso Fleming amava raccontarlo. Le scene sono poche, non pi√π di quattro, i veri personaggi anche meno. James Bond impareremo a conoscerlo meglio, perch√© qui √® ancora nei panni ‚Äì eleganti, spiritosi, crudeli ‚Äì di Ian Fleming. Ma l\'abominevole Le Chiffre, e il suo occhio quasi bianco, non li dimenticheremo, come difficile sar√† scordare la Bond Girl forse pi√π letale, la sublime Vesper Lynd. Tutto dunque comincia da qui, dall\'o¬≠dore nauseante di un casin√≤ alle tre del mattino. E la speranza √® che duri il pi√π a lungo possibile.', 'Adelphi', NULL, NULL, '9788845927010', 'data:image/jpeg;base64,', 0);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(14, 'L', 'Vivi e lascia morire', 1954, 'A Ian Fleming viene universalmente attribuita l\'invenzione di una figura letteraria prima di lui non esistente, la Bond Girl: e la Solitaire di Vivi e lascia morire, una veggente vud√π con gli occhi quasi viola, i capelli quasi blu e un legittimo sospetto di verginit√† √® una delle rappresentanti pi√π autorevoli della categoria. Ma meno attenzione si presta, in genere, al secondo grande copyright di Fleming, il Bond Villain. Anche qui, Mr Big ‚Äì occhi gialli, pelle grigia, il corpo enorme sorretto a stento da un cuore malato, e il pi√π che legittimo sospetto di essere, in realt√†, lo zombie del sommo sacerdote vud√π, Baron Samedi ‚Äì ha pochi rivali. Si aggiungano, a piacere, una notte brava nei locali notturni di Harlem, la scoperta dell\'America e della Giamaica, una strepitosa sequenza sottomarina, e sullo sfondo la caccia al tesoro di Morgan il Sanguinario. Gli ingredienti per l\'avventura pi√π leggera, crudele e incalzante di 007 insomma ci sono tutti: basta solo agitarli, una pagina dopo l\'altra.', 'Adelphi', NULL, NULL, '9788845926907', 'data:image/jpeg;base64,', 1);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(15, 'L', 'Moonraker', 1955, 'Per la seconda parte di questo romanzo, in cui Bond tenta di scongiurare l\'attacco nucleare che il diabolico Hugo Drax ha pianificato contro Londra, Fleming aveva fatto ricerche molto accurate, sfruttando la consulenza sia del¬≠l\'ente spaziale britannico sia del futuro autore di 2001: Odissea nello spazio Ar¬≠thur C. Clarke. Per la lunghissima e tormentosa partita a bridge ‚Äì contro Hugo Drax, naturalmente ‚Äì, invece, cos√¨ come per i molti e preziosi dettagli sulla vita notturna londinese, e per la fisionomia della terza Bond Girl della serie, la formidabile Gala Brand, aveva attinto a quella che comunemente si chiama ¬´esperienza personale¬ª. ', 'Adelphi', NULL, NULL, '9788845927959', 'data:image/jpeg;base64,', 0);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(16, 'L', 'Dalla Russia con amore', 1957, 'La meticolosa preparazione di una trappola diabolica ai danni di Bond, nelle stanze pi√π segrete e pi√π cupe di una Mosca ancora staliniana; un lungo e molto fascinoso intermezzo nella citt√† di tutte le trame e di tutti gli intrighi, Istanbul; un fuori programma assai movimentato in un campo di zingari (e soprattutto zingare); un viaggio attraverso l‚ÄôEuropa sul treno dove molte passioni e altrettanti crimini finivano un tempo per consumarsi: l‚ÄôOrient-Express. S√¨, Dalla Russia con amore √® la smersh, e Tat\'jana, e Rosa Klebb, e la lama avvelenata nascosta nella scarpa: nella grande storia da cui √® nato 007 come oggi lo conosciamo, e che √® anche stata il primo successo popolare di Fleming.', 'Adelphi', NULL, NULL, '9788845930447', 'data:image/jpeg;base64,', 1);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(17, 'L', 'Il Dottor No', 1958, 'Dopo cinque romanzi, Ian Fleming confess√≤ al suo amico Eric Ambler di avere finalmente capito quali fossero gli ingredienti base per una delle sue (delle loro) storie: ¬´ragazze nude, spie, e armi nucleari¬ª, meglio se ospitate sulla stessa isola. Di isole adatte al sesto episodio di 007 Fleming ne aveva visitate parecchie, e la pi√π attraente era senz\'altro Great Inagua, nelle Bahamas: colonie di uccelli rari protetti dalla Audubon Society, grandi paludi, mangrovie, granchi giganti assai temibili ‚Äì e guano ovunque. Anche la trama era gi√† pronta, bastava prendere un trattamento per la televisione americana di qualche anno prima, mai realizzato, in cui Fleming aveva ipotizzato che una misteriosa, potentissima organizzazione criminale possedesse apparecchiature in grado di deviare i missili intercontinentali americani. Bisognava solo trovarle un capo, magari prestandogli qualche tratto di un cattivo per antonomasia, il dottor Fu Manchu, e il gioco era quasi fatto.', 'Adelphi', NULL, NULL, '9788845931338', 'data:image/jpeg;base64,', 0);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(18, 'F', 'Skyfall', 2012, 'James Bond √® a Istanbul per recuperare un file contenente le identit√† degli agenti NATO infiltrati nelle maggiori organizzazioni terroristiche e criminali mondiali. Nonostante gli sforzi di Bond (sforzi che comprendono un inseguimento in moto sui tetti del bazar della citt√† e una lotta corpo a corpo in cima ad un treno in corsa), il file viene rubato dal sicario Patrice. Questi, alla fine, riesce a fuggire mentre Bond viene colpito per sbaglio dalla sua collega sul campo e precipita in un fiume.', NULL, 'Sam Mendes', 'Daniel Craig, Javier Bardem, Ralph Fiennes, Naomie Harris, B√©r√©nice Marlohe, Albert Finney, Judi Dench', NULL, 'data:image/jpeg;base64,', 1);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(19, 'F', 'Solo per i tuoi occhi', 1981, 'Una nave britannica (che sembrerebbe un peschereccio, ma in realt√† √® una nave spia), la St. Georges, a seguito dell\'esplosione di un residuo bellico, una mina navale, impigliatasi accidentalmente nelle reti, s\'inabissa nel Mare Ionio, a poca distanza dalla costa albanese, trascinando con s√© l\'intero equipaggio.', NULL, 'John Glen', 'Roger Moore, Carole Bouquet, Chaim Topol, Lynn-Holly Johnson, Julian Glover', NULL, 'data:image/jpeg;base64,', 0);
INSERT INTO `opere` (`id`, `tipologia`, `titolo`, `anno_di_pubblicazione`, `trama`, `editore`, `regista`, `cast`, `isbn`, `immagine`, `prenotato`) VALUES
(23, 'F', 'No Time to Die', 2021, 'Una giovane Madeleine Swann √® testimone dell\'omicidio di sua madre da parte di un uomo mascherato, successivamente rivelato essere Lyutsifer Safin, che desidera vendicarsi della famiglia di Madeleine.', NULL, 'Cary Fukunaga', 'Daniel Craig, Rami Malek, L√©a Seydoux, Lashana Lynch, Ben Whishaw, Naomie Harris, Jeffrey Wright, Christoph Waltz, Ralph Fiennes', NULL, 'data:image/jpeg;base64,', 0);

